script: |
  super -f text -I q13395.spq | sort > q13395.out

inputs:
  - name: q13395.spq
    data: |
      SELECT DISTINCT + col2 + col0, CAST ( + + ( - + col2 ) AS REAL ) AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) NOT IN ( col0, - col2 + + 34 * - col0 + + + col2 - - col1 + + + col0 );
  - name: tab2

outputs:
  - name: q13395.out
    data: |
